import React from 'react'
/*import NavBar from './Components/NavBar';
import Featured from './Components/Featured';
import Header from './Components/Header';
import Trending from './Components/Trending';
import Throwback from './Components/Throwback';*/
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
import NavBar from './Components/NavBar';
import Home from './Components/Home'
import Sample from './Components/Sample'

function App() {
  return (
    <div className="bg-[#1A1A1A]">
      
      <BrowserRouter>
      <header>
      <nav className="absolute flex -space-x-[-505px] text-white pl-20 pt-16">
        <p className="text-2xl font-['Outfit'] font-semibold">AnimeBinge</p>
        <div className="flex gap-16 items-center">
            <Link to="home"><button className="text-base">Home</button></Link>
            <button className="text-base">Discover</button>
            <button className="text-base">About Us</button>
            <div className="flex gap-5 items-center">
            <button className="rounded-md bg-transparent border-[1px] border-white text-base px-8 py-3">Sign Up</button>
            <button className="rounded-md bg-[#106580] border-[1px] border-[#106580] text-base px-8 py-3">Log In</button>
            </div>
        </div>
        </nav>
        </header>
      <Routes>
        <Route path="/home" element={<Home />}>
        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
